Up for sale is my ASM made, 1847 Colt Walker. I just fit a new hand to it, and spare new cylinder. I have owned it for about 15 years, give or take. $350. I have two new spare trigger/lock springs, and another new hand that come with it for spare parts. Might have a spare trigger around here somewhere. Oh, hand made big ass holster comes with it.




I also have this Pietta made 1863 Remington, 31 caliber pocket pistol. It is a steel framed one, and they typically go for $265 to $275 new. This one is new, and unfired. I'll take $200 for it, or as usual, trades. Here's a link to one. You have to scroll down til you get to the steel frame (on the right);

http://fcsutler.com/fccwrevolvers.asp

